import React, { useState } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch, faPlus } from '@fortawesome/free-solid-svg-icons';
import { useNavigate } from "react-router-dom";

const TravelBucketlist = () => {
  const [searchQuery, setSearchQuery] = useState("");
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const [selectedCity, setSelectedCity] = useState("");
  const navigate = useNavigate();

  const handleSearch = (event) => {
    event.preventDefault();
    // Perform search based on the searchQuery and selectedCity
    // You can implement your logic here to search the map or perform any other actions
    console.log("Search query:", searchQuery);
    console.log("Selected city:", selectedCity);
    navigate("/interestmatching"); // Redirect to "/interestmatching"
  };

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  const selectCity = (city) => {
    setSelectedCity(city);
    setIsDropdownOpen(false);
  };

  return (
    <div className="travel-bucketlist layout-container">
      <div className="map">
        {/* Add your map component or use an iframe to display the map */}
        {/* Example: <iframe src="your_map_url" title="Map" /> */}
      </div>
      <div className="city-names">
        <p>City 1</p>
        <p>City 2</p>
        <p>City 3</p>
        <p>City 4</p>
        <p>City 5</p>
      </div>
      <form className="search-bar">
        <div className="search-input">
          <input
            type="text"
            placeholder="Search in map..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
          <button className="search-icon" onClick={handleSearch}>
            <FontAwesomeIcon icon={faSearch} />
          </button>
        </div>
        <div className="city-dropdown">
          <button className="dropdown-toggle" onClick={toggleDropdown}>
            <FontAwesomeIcon icon={faPlus} />
          </button>
          {isDropdownOpen && (
            <ul className="city-list">
              <li onClick={() => selectCity("City 1")}>City 1</li>
              <li onClick={() => selectCity("City 2")}>City 2</li>
              <li onClick={() => selectCity("City 3")}>City 3</li>
              <li onClick={() => selectCity("City 4")}>City 4</li>
              <li onClick={() => selectCity("City 5")}>City 5</li>
            </ul>
          )}
        </div>
      </form>
    </div>
  );
};

export default TravelBucketlist;
